import { Stack, Heading, HStack, Text, Input } from "@chakra-ui/react";
import FormInput from "../components/FormInput";

const Profile = () => {
  return (
    <>
        <Stack spacing={4}>
            <Heading as='h2' size='lg'>Profile</Heading>
            <FormInput label='Name:' placeholder='John Doe'/>
        </Stack>
    </>
  );
};

export default Profile;
